from sympy import *
import numpy as np



def 指数矩阵(x,M):
    EM = []
    for i in range(len(M)):
        hang = []
        for j in range (len(M[0])):
            if i==j:
                hang.append( exp(M[i][j]*x) )
            else:
                hang.append( 0 )
        EM.append(hang)
    return EM

def matrix_round(M,n):
    EM = []
    for i in range(len(M)):
        hang = []
        for j in range (len(M[0])):
            hang.append( round(M[i][j],n)  )
        EM.append(hang)
    return EM

def matrix_intergal(M,t,a,b):
    IM = []
    for i in range(len(M)):
        hang = []
        for j in range (len(M[0])):
            intergal = integrate(M[i][j], (t,a,b))
            hang.append( intergal  )
        IM.append(hang)
    return IM


t = symbols('t') # 定义符号变量

P = np.mat([[0.01951666,0.00133843,0.00318622],
            [0.00810098,0.01550481,0.00982069],
            [0.02406615,0.00679688,0.01145372]])

# 1. 求矩阵P的特征向量
eigenvalue ,eigenvector= np.linalg.eig(P)

P_J = np.linalg.inv(eigenvector)*P*eigenvector
print( "\n P_J \n",P_J  )

P_Jt = [[ 2.92688566e-02, 0 , 0],
        [0 , 1.39105823e-02, 0],
        [0 , 0 , 3.29575110e-03]]

eigenvector = np.mat( matrix_round(eigenvector.tolist(),6) )
P_Jt =  matrix_round(P_Jt,3) 
